INSERT INTO `examples` VALUES (1,'Alice wants to buy shoes and she wants to shop online. She heads to an online shop and searches for shoes but can’t decide which ones she wants, so she buys neither of them. The next day she finds a couple of emails in her inbox, giving her suggestions for other shoes and alerting her that the viewed shoes are now on sale.','2024-05-21 11:27:59.581000','2024-05-21 11:27:59.581000',1,1),(2,'Twitter.com removes EXIF data from images uploaded to their image sharing service. Previously there have been many breaches of personal location by using EXIF data shared by image sharing services.','2024-05-21 11:28:44.059000','2024-05-21 11:28:44.059000',1,1),(3,'Flickr.com is a system features based on metadata, the metadata sharing is an important part of the community of users. Flickr.com allows users to hide their EXIF data from public display, and also provides an interface for users to easily see whether they are sharing location as part of uploading their images.','2024-05-21 11:29:03.976000','2024-05-21 11:29:03.976000',1,1),(4,'An electric utility operates a smart grid network with smart meters that provide measurements of the instantaneous power consumption of each user. The utility employs that information to both adapt the power distribution in a dynamic fashion, according to user demand at each moment, and bill the each client periodically, according to his aggregated consumption over the billing period. However, this information can also be exploited to infer sensitive user information (e.g. at what time he or she leaves and comes back to home, etc.)','2024-05-21 11:29:47.747000','2024-05-21 11:29:47.747000',1,1),(5,' Assume a [company] stores all employees\' data [through a controller\'s service]. There is a contractual agreement between [them] that each data leakage is reported within one hour. Now Bob, an employee of [the controller] and not authorized to read [the company\'s] data, succeeds in circumventing [the] access control mechanisms and reads [personal] data. This represents a data breach of which [the company] has to be notified within an hour.','2024-05-21 11:30:15.172000','2024-05-21 11:30:15.172000',1,1),(6,'Gmail displays information about other sessions (if any) in the footer, linking to a page named \"Activity on this account\" which lists other sessions and recent activities to the Gmail account. The user has the option to sign out other sessions. In case of annoying false positives, the user may choose to disable the alert for unusual activity. The disable takes about a week, \"to make sure the bad guys aren\'t the ones who turned off your alerts.\"','2024-05-21 11:31:27.612000','2024-05-21 11:31:27.612000',1,1),(7,' When Facebook detects an unusual sign-in, it shows \'social authentication\' that displays a few pictures of the user\'s friends and asks the user to name the person in those photos.','2024-05-21 11:31:43.173000','2024-05-21 11:31:43.173000',1,1),(8,'Many online organizations provide signals to their customers. Often they are publicly and freely available, but can also be purchased by third parties. The online auction site, eBay, for example, uses a reputation system to assist other buyers in feeling more comfortable purchasing from an unknown seller. Many other ecommerce sites (such as Amazon) rely heavily on the reputation and referral systems in order to help customers make a more informed decision.','2024-05-21 11:32:14.785000','2024-05-21 11:32:14.785000',1,1),(9,'Alice is a whistle-blower and tries to forward data to Bob who works at the press. She sends the corresponding documents as an e-mail-attachment. Eve monitors the traffic and can see who sent this mail to whom. The next day, police raids Alice\'s apartment and sends her to jail. Bobs mail account gets seized.','2024-05-21 11:32:44.161000','2024-05-21 11:32:44.161000',1,1),(10,'The TOR-browser, a web-browser specifically designed to ensure anonymity makes heavy use of onion routing.','2024-05-21 11:33:11.499000','2024-05-21 11:33:11.499000',1,1),(11,'Least Authority: secure off-site backup system with client side encryption.','2024-05-21 11:33:41.422000','2024-05-21 11:33:41.422000',1,1),(12,' LastPass: encrypted credentials and personal information database with user managed encryption keys.','2024-05-21 11:34:01.923000','2024-05-21 11:34:01.923000',1,1),(13,'Alice wants to search for an abortion clinic on Google, but she does not want to reveal her intentions of abort to an adversary that may be eavesdropping this search (e.g., ISP provider, system administrator of her workplace, etc).','2024-05-21 11:34:43.258000','2024-05-21 11:34:43.258000',1,1),(14,'An Identity Provider issues pseudonyms to authenticate users at third-party Service Providers, which can in turn check the authenticity of these pseudonyms at the Identity Provider, without getting to know the real user identity. However, the Identity Provider knows all the services requested by the users, which discloses personal information to the Identity Provider and allows it to profile the users.','2024-05-21 11:34:59.737000','2024-05-21 11:34:59.737000',1,1),(15,'A service provider subcontracts services, but requires that the data to be deleted after a certain time and that the service provider requires to be notified if there is further subcontracting.','2024-05-21 11:35:16.957000','2024-05-21 11:35:16.957000',1,1),(16,'When data is shared by an organisation they can use privacy preserving policy to enforce respecting user privacy by third party organisations that use, process and store such data. For example, a hospital may share data with third party organisations requiring adhering to specific privacy policies associated with the data.','2024-05-21 11:35:36.012000','2024-05-21 11:35:36.012000',1,1),(17,'In the health sector, patients want to keep control over their health data but also to grant specific access to some health professionals.','2024-05-21 11:35:58.663000','2024-05-21 11:35:58.663000',1,1),(18,'Wikipedia allows any visitor to modify its contents, even without having been authenticated. Some malicious visitors may vandalize the contents. If a visitor coming from the same IP address keeps vandalizing the site, they will earn a bad reputation, and their IP will be banned from modifying the contents anymore (however, users accessing through a Tor anonymity network proxy cannot be identified from their IPs, and thus their reputation cannot be tracked).','2024-05-21 11:36:20.413000','2024-05-21 11:36:20.413000',1,1),(19,'Yahoo! Fire Eagle allows user to provide location information to applications using eight different \"levels\" of granularity in their hierarchy: No information, As precise as possible, Postal code, Neighborhood, Town, Region, State and Country. Fire Eagle specifically requires that recipient applications be written to handle data at any of the levels, and allows updating the user\'s location at any level of granularity.','2024-05-21 11:36:36.602000','2024-05-21 11:36:36.602000',1,1),(20,'Twitter allows users to tag a tweet with either exact coordinates, a Twitter \"place\" (a town, neighborhood or venue) or both.','2024-05-21 11:36:53.100000','2024-05-21 11:36:53.100000',1,1),(21,'On Facebook, before publishing a post, you can set one of three levels of privacy for the post which can be \"Everyone\", \"Friends Only\", \"Private\". In the first case the post can be seen by any Facebook user, in the second case the post can only be seen by the friends of the post user, finally, in the last case the post is not visible to anyone except the owner.','2024-05-21 11:37:46.031000','2024-05-21 11:37:46.031000',1,1),(22,'We hire a healthcare center, data controller, an interested user and a subcontractor, provider of sensor networks for monitoring user health. This subcontractor requires additional specific, informed, explicit and freely given consent from you.','2024-05-21 11:38:14.357000','2024-05-21 11:38:14.357000',1,1),(23,' Unmonitored communications systems to ensure free speech. Pseudonymous messages do not allow us to trace the sender of the message.','2024-05-21 11:38:48.246000','2024-05-21 11:38:48.246000',1,1),(24,'Aims to provide some privacy, but it is important to be aware of the possible vulnerabilities in using a pseudonym , which can be countered by implementing additional security measures if necessary.','2024-05-21 11:41:09.200000','2024-05-21 11:41:09.200000',1,1),(25,'An electric utility operates a smart grid network with smart meters that provide measurements of the instantaneous power consumption of each user. The utility employs that information to adapt the power distribution in a dynamic fashion, according to the user demand at each moment.','2024-05-21 11:41:25.520000','2024-05-21 11:41:25.520000',1,1),(26,' Every system that involves the use of a password to protect personal data should implement a password generation tool. This system, in addition to generating passwords, must educate users to create secure passwords.','2024-05-21 11:41:48.769000','2024-05-21 11:41:48.769000',1,1);
/*!40000 ALTER TABLE `examples` ENABLE KEYS */;
UNLOCK TABLES;

