INSERT INTO `patterns` VALUES (1,'Protection against Tracking','This Pattern avoids tracking website visitors by cookies. It does this by deleting them at regular intervals or disabling cookies completely.\n','This pattern is applicable when personal identifiable information is tracked through software tools, protocols or mechanisms such as cookies and the like.\n','2024-05-21 09:58:07.051000','2024-06-09 14:33:50.273000',1,1,1),(2,'Strip Invisible Metadata','Delete potentially sensitive metadata that is not directly visible to the end user.\n','When a service requires a user to import data from external sources (e.g., images, tweets, documents), different types of metadata may be transmitted. Users may not be aware of metadata since it may be automatically generated or not directly visible. Services may be unintentionally responsible for exposing private metadata or going against users\' expectations.\n','2024-05-21 10:23:54.892000','2024-06-04 14:41:55.876000',1,1,11),(3,'Added-noise measurement obfuscation','Add some noise to service operation measurements, but make it cancel itself in the long-term.\n','A service provider gets continuous measurements of a service attribute linked to a service individual.\n','2024-05-21 10:30:29.847000','2024-06-03 13:05:07.540000',1,1,7),(4,'Data Breach Notification Pattern','Managers of services (or products) provided to users collect massive amounts of data, much of it personal, to improve the quality and user experience of that service. All this must be done with the informed consent of the user, who must properly understand the risks associated with his or her data. One such risk is that of unauthorized access, modification, removal, or sharing of data. If a data breach occurs, notification is required. Any data controller within the EU (or providing services or products within the EU) must notify the supervisory authority of its principal establishment or representative. Notification must be made within 72 hours, unless warranted. Notification to users depends on whether they are sufficiently concerned.\n','Managers of services (or products) provided to users collect large amounts of data, much of it personal, to improve the quality and user experience of that service. All this must be done under the informed consent of the user, who should properly understand the risks associated with their data. One such risk is that of unauthorized access, modification, removal, or sharing of data. If such a data breach occurs, you must notify us. Any operator within (or providing services or products within) the EU must notify the supervisory authority of its main establishment or representative. This must be done within 72 hours unless justified. Notification to users depends on the degree of sufficient impact on their situation.\n','2024-05-21 10:37:45.326000','2024-06-06 10:14:57.173000',1,1,3),(5,'Unusual Activities','Prevent suspicious access to user data through alerts and perform authentication through multiple factors in case of potential account compromise.\n','Services (or products), especially on the Internet, tend to use username and password-based authentication. This security mechanism is very convenient for users, as it is widespread and simple compared to more secure alternatives. However, it is subject to common flaws. Passwords become less secure as they remain unchanged, are often vulnerable to brute force attacks, espionage and phishing, and cannot be proven to be held exclusively by the user. This complicates the certainty of authentication, and thus the authenticity of any decision made by the user, including consent. Controllers may derive additional factors, such as device- or access-specific information. If location is provided, for example, it might suggest unlikely account activity.\n','2024-05-21 10:38:23.623000','2024-06-09 14:35:06.134000',1,1,6),(6,'Minimal Information Asymmetry','Prevent users from being disenfranchised by their lack of familiarity with the policies, potential risks, and their agency within processing.\n','Users frequently interact with controllers whose services (or products) they have not used before. At this point the knowledge the user has about the controller and its practices, especially regarding privacy, is typically nonexistent. The controller as a whole has a much clearer understanding of its policies. It also begins to know a lot about the user in a short time period, if not already well informed. The user needs to put in sufficient effort to investigate the controller to know about its practices to provide valid consent. The controller needs this valid consent to lawfully process the user\'s information.\n','2024-05-21 10:38:50.473000','2024-06-05 15:58:05.378000',1,1,3),(7,'Onion Routing','This model ensures nonlinkability between senders and receivers by encapsulating data in different layers of encryption, limiting the knowledge of each node along the delivery path.\n','A system in which data is routed between different nodes.\n','2024-05-21 10:39:08.151000','2024-06-04 17:05:36.907000',1,1,4),(8,'Encryption with user-managed keys','Use encryption in such a way that the service provider cannot decrypt the user\'s information because the user manages the keys.\n','User wants to store or transfer their personal data through an online service and they want to protect their privacy, and specifically the confidentiality of their personal information. Risks of unauthorized access may include the online service provider itself, or third parties such as its partners for example for backup, or government surveillance depending on the geographies the data is stored in or transferred through.\n','2024-05-21 10:39:26.146000','2024-06-03 13:03:09.395000',1,1,1),(9,'Use of dummies','This pattern hides the actions taken by a user by adding fake actions that are indistinguishable from real.\n','This pattern is applicable when it is not possible to avoid executing, delaying or obfuscating the content of an action.\n','2024-05-21 10:39:43.038000','2024-06-03 12:59:46.910000',1,1,1),(10,'Federated Privacy Impact Assessment','The impact of personal information in a federation is more than the impact in the federated.\n','Identity Management scenarios (that is, when the roles of the Identity Provider and the Service Provider are separated).\n','2024-05-21 10:39:59.177000','2024-06-03 15:00:43.756000',1,1,0),(11,'Obligation Management','The pattern allows obligations relating to data sharing, storing and processing to be transferred and managed when the data is shared between multiple parties.\n','The developer aims to make sure that multiple parties are aware of and comply with required user/organisational policies as personal and sensitive data are successively shared between a series of parties who store or process that data.\n','2024-05-21 10:40:22.622000','2024-06-03 14:14:37.895000',1,1,0),(12,'Sticky Policies','Machine-readable policies are sticked to data to define allowed usage and obligations as it travels across multiple parties, enabling users to improve control over their personal information.\n','Multiple parties are aware of and act according to a certain policy when privacy-sensitive data is passed along the multiple successive parties storing, processing and sharing that data.\n','2024-05-21 10:41:00.173000','2024-06-02 17:41:04.402000',1,1,1),(13,'Personal Data Store','Subjects keep control on their personal data that are stored on a personal device.\n','The pattern is applicable to any data produced by the data subject (or originally under his control) as opposed to data about him produced by third parties.\n','2024-05-21 10:41:23.548000','2024-06-03 13:02:18.099000',1,1,1),(14,'User data confinement pattern','Avoid the central collection of personal data by shifting some amount of the processing of personal data to the user-trusted environments (e.g. their own devices). Allow users to control the exact data that shares with service providers.\n','This pattern may be used whenever the collection of personal data with one specific and legitimate purpose still pose a relevant level of threat to the users\' privacy.\n','2024-05-21 10:41:40.107000','2024-06-03 14:15:41.107000',1,1,0),(15,'Anonymous Reputation-based Blacklisting','Get rid of troublemakers without even knowing who they are.\n','A service provider provides a service to users who access anonymously, and who may make bad use of the service.\n','2024-05-21 10:42:01.240000','2024-06-03 14:13:44.454000',1,1,0),(16,'Location Granularity','Support minimization of data collection and distribution. Important when a service is collecting location data from or about a user, or transmitting location data about a user to a third-party.\n','When a service is collecting location data from or about a user, or transmitting location data about a user to a third-party.\n','2024-05-21 10:42:19.118000','2024-06-03 14:14:25.658000',1,1,0),(17,'Discouraging blanket strategies','Give users the possibility to define a privacy level from a range of options each time they share content.\n','Socially oriented services on the Internet allow their often diverse userbase to share content. These masses of users and shared content are also varied enough to discourage individual attention. Controllers prefer to protect themselves from additional complexity and investment into features which provide them with less data. Users, however, feel in need of privacy settings to distinguish their personal risk appetite from that of the norm. They each have their own ideas about the sensitivities of their information, which makes sufficient controls difficult to implement.\n','2024-05-21 10:42:37.115000','2024-06-03 14:13:52.503000',1,1,0),(18,'Reciprocity','Let users benefit according to the contributions they make.\n','In services where users may either socially or collaboratively contribute, participation may be a foundation for the service\'s business model. In these situations the quality and frequency of content affects the success of the service, and thus users have a large impact on its survival. Whether any single user contributes, or not, plays a role in profitability, which puts the controller in a position to encourage or enforce equal participation. Users may respond to such ideas negatively, however, especially if they do not see potential gains worthy of their effort and personal risks to privacy.\n','2024-05-21 10:43:00.185000','2024-06-03 14:15:19.324000',1,1,0),(19,'Incentivized Participation','Users are more willing to contribute valuable input when they can do so without leaking personal data, or perceive an equal or greater exchange in value either monetarily or socially.\n','A data controller derives various values from the participation of its users (i.e. data subjects). The more that these users participate, explicitly providing context and implicitly providing metadata (e.g. statistics and telemetry), the better the controller fares in a number of respects. Despite this key relation, over-sharing can greatly infringe upon a user\'s right to privacy. Many controllers therefore aim to respect this right when benefiting from user interactions. As the controller should recognise the necessity of specific, informed, and freely given Lawful Consent, users are made aware of the pitfalls of such a system. As they are informed, perhaps through a combination of a Privacy Dashboard or Awareness Feed, users may balance the privacy related tradeoffs. This minimises the privacy risks taken according to the user\'s personal informed choices, and protects the controller from inadvertently undermining the user\'s privacy. The controller still desires participation, however, and may therefore make additional concessions or provisions to help make the tradeoff worthwhile or non-existent. The controller may complement its strategy with more granular choice in order to achieve this, such as with Selective Disclosure and Selective Disruption.\n','2024-05-21 10:43:44.217000','2024-06-03 14:14:08.227000',1,1,0),(20,'Outsourcing [with consent]','The controller has to obtain additional specific, informed, explicit, and freely given consent before outsourcing data processing to a third party.\n','Controllers often do not have the means to feasibly or sufficiently process the data they oversee to the extent they desire. In these cases they seek an external processor or third party to handle the process. This typically conflicts with their already obtained consent from their users (their data subjects), as further processing by a third party is not necessarily compatible with the agreed upon purposes. In these situations the controller does not have legally obtained consent for this processing and will be liable if they carry it out.\n','2024-05-21 10:44:05.042000','2024-06-03 14:14:51.505000',1,1,0),(21,'Sign an Agreement to Solve Lack of Trust on the Use of Private Data Context','Services of a controller may require users to sign contracts that stipulate their obligations and processing purposes for which users must consent to use the service. This ensures that users can trust the controller as it is bound to the contract it signs.\n','Users do not inherently trust controllers who provide services (or products), as they do not have assurances as to what the controller\'s or their processor\'s true intentions are. Controllers and processors typically aim to make profit, but this might be at the expense of users if those users do not consider their privacy needs. The controller might have reasonable defaults or levels of control, but users also need to feel reassured that their choices are being honored. This is especially true of what they do or do not provide Lawful Consent for.\n','2024-05-21 10:44:23.143000','2024-06-03 14:15:28.445000',1,1,0),(22,'Pseudonymous Messaging','A messaging service is enhanced by using a trusted third party to exchange the identifiers of the communication partners by pseudonyms.\n','This pattern can be used for online communications by email, through message boards, and newsgroups.\n','2024-05-21 10:44:43.142000','2024-06-03 14:15:12.702000',1,1,0),(23,'Pseudonymous Identity','Hide the identity by using a pseudonym and ensure a pseudonymous identity that can not be linked with a real identity during online interactions.\n','This pattern can be used for systems in which users are identified by public identities.\n','2024-05-21 10:45:01.213000','2024-06-03 14:15:05.665000',1,1,0),(24,'Aggregation Gateway','Encrypt, aggregate and decrypt at different places.\n','A service provider gets continuous measurements of a service attribute linked to a set of individual service users.\n','2024-05-21 10:45:23.934000','2024-06-03 14:13:29.962000',1,1,0),(25,'Informed Secure Passwords','Ensure that users maintain healthy authentication habits through awareness and understanding.\n','Credentials are required by numerous services (and products) in order to ensure that only authenticated and authorized users have access to certain features. Controllers typically provide authentication mechanisms in the form of usernames and passwords. Although these provide a weak form of security when used incorrectly, they are more convenient for users than many less popular and more secure alternatives. Controllers often try to circumvent the shortcomings of passwords by encouraging users to change them frequently, use stronger variations, check them, and prevent disclosure and reuse. However users make use of many services, and use many passwords, thus discouraging proper application. This misapplication can result in personal data being accessed by unauthorized persons.\n','2024-05-21 10:45:42.277000','2024-06-03 14:14:15.982000',1,1,0),(27,'funzionerà?','ddddddddd','dddd','2024-06-05 18:10:09.520000','2024-06-09 12:49:42.093000',1,1,0),(28,'Mo vediamo','ddddddddd','dddd','2024-06-06 13:54:18.248000','2024-06-08 13:45:25.849000',NULL,NULL,0),(29,'Mo vediamo','ddddddddd','dddd','2024-06-06 13:56:55.134000','2024-06-09 14:28:43.398000',NULL,NULL,0),(30,'Mo vediamo','ddddddddd','dddd','2024-06-06 13:57:54.201000','2024-06-08 16:06:36.986000',NULL,NULL,0),(31,'Mo vediamo','ddddddddd','dddd','2024-06-06 13:58:39.404000','2024-06-08 15:34:47.837000',NULL,NULL,0),(32,'Protection against Tracking','This Pattern avoids tracking website visitors by cookies. It does this by deleting them at regular intervals or disabling cookies completely.','This pattern is applicable when personal identifiable information is tracked through software tools, protocols or mechanisms such as cookies and the like.','2024-06-08 10:55:35.096000','2024-06-09 13:33:02.624000',NULL,NULL,0),(33,'Protection against Tracking','This Pattern avoids tracking website visitors by cookies. It does this by deleting them at regular intervals or disabling cookies completely.','This pattern is applicable when personal identifiable information is tracked through software tools, protocols or mechanisms such as cookies and the like.','2024-06-08 11:00:22.039000','2024-06-08 11:00:22.039000',NULL,NULL,0),(34,'Pseudonymous Messaging','A messaging service is enhanced by using a trusted third party to exchange the identifiers of the communication partners by pseudonyms.','This pattern can be used for online communications by email, through message boards, and newsgroups.','2024-06-08 11:18:09.028000','2024-06-09 13:38:04.935000',NULL,NULL,0),(35,'ddd','ddd','ddd','2024-06-08 17:43:58.871000','2024-06-08 17:43:58.871000',NULL,NULL,0);
